import "../css/doctors-advanced-search.css";
import avatar from "../avatar.jpg";
import { util } from "../public/util";
import { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import Calendar from "../inputs/calendar";
import { Modal } from "react-bootstrap";
import { doctorController } from "../controllers/doctor";

const DoctorsAdvancedSearch = ({ ...props }) => {
  const [calendarId, setCalendarId] = useState(5);

  const loadCalendar = (e, id) => {
    e.preventDefault();
    setCalendarId(5);
  };
  return (
    <div className="container-fluid row search-div">
      <div className="doctor-list col-6">
        {props.data.map((doctorInfo, i) => {
          return (
            <div className="doctor-card col-12">
              <div className="d-flex">
               <div className="col-1">
               <img src={avatar} className="doctor-image" alt="" />
                 </div>
                <div className="d-flex col-4 flex-column align-items-center justify-content-center">
                  <span>{doctorInfo.name}</span>
                  <span>Appoitment Price: {doctorInfo.Price}</span>
                  <span>Work offices number: {doctorInfo.location.length}</span>
                </div>
                <div className="d-flex col-6 flex-column align-items-center justify-content-center">
                  <span>
                    <a href="#" onClick={(e) => loadCalendar(e, doctorInfo.id)}>
                      View Calendar
                    </a>
                  </span>
                  <div className="d-flex align-items-center justify-content-between">
                    <button>
                      {" "}
                      <Link to={"/view-profile/" + doctorInfo.id}>
                        {" "}
                        View Profile
                      </Link>{" "}
                    </button>

                    <button>Add to Favorites</button>
                  </div>
                </div>
              </div>
            </div>
          );
        })}
      </div>
      <div className="col-6 calendar-column">
        <Calendar allowEdit={true} doctorId={calendarId} />
      </div>
    </div>
  );
};

export default DoctorsAdvancedSearch;
